import React, { useState } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  CssBaseline,
  Box,
  Menu,
  MenuItem,
  Button,
  TextField,
  InputAdornment,
  FormControl,
  InputLabel,
  Select,
  SelectChangeEvent,
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import SearchIcon from '@mui/icons-material/Search';
import PublicIcon from '@mui/icons-material/Public'; // This is the logo button icon
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#000',
      paper: '#121212',
    },
    text: {
      primary: '#fff',
      secondary: '#b0bec5',
    },
  },
  typography: {
    h6: {
      fontSize: '1.25rem',
      fontWeight: 700,
      color: '#fff',
    },
  },
});

const Dashboard = () => {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);
  const [countryMenuAnchorEl, setCountryMenuAnchorEl] = useState(null);
  const [selectedCountry, setSelectedCountry] = useState('');
  const isMenuOpen = Boolean(anchorEl);
  const isCountryMenuOpen = Boolean(countryMenuAnchorEl);
  const username = 'John Doe'; // Example username

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    // Implement logout functionality here
    handleMenuClose();
  };

  const handleCountryMenuOpen = (event) => {
    setCountryMenuAnchorEl(event.currentTarget);
  };

  const handleCountryMenuClose = () => {
    setCountryMenuAnchorEl(null);
  };

  const handleCountryChange = (event) => {
    setSelectedCountry(event.target.value);
    handleCountryMenuClose();
  };

  const countries = [
    'USA', 'Canada', 'UK', 'Australia', // Add more countries as needed
  ];

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="fixed">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={() => setDrawerOpen(!drawerOpen)}>
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Sports Tournament
          </Typography>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <TextField
              label="Search"
              variant="outlined"
              size="small"
              sx={{ bgcolor: 'background.paper' }}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <SearchIcon sx={{ color: '#fff' }} />
                  </InputAdornment>
                ),
              }}
            />
            <IconButton edge="end" color="inherit" aria-label="country" onClick={handleCountryMenuOpen} sx={{ ml: 2 }}>
              <PublicIcon />
            </IconButton>
            <Menu
              anchorEl={countryMenuAnchorEl}
              open={isCountryMenuOpen}
              onClose={handleCountryMenuClose}
              PaperProps={{
                sx: {
                  backgroundColor: '#0A0A0A',
                  color: '#fff',
                },
              }}
            >
              {countries.map((country) => (
                <MenuItem key={country} onClick={() => handleCountryChange({ target: { value: country } })}>
                  {country}
                </MenuItem>
              ))}
            </Menu>
            <Button color="inherit" sx={{ ml: 2 }} variant="outlined">
              Advertise Tournament
            </Button>
            <IconButton edge="end" color="inherit" aria-label="profile" onClick={handleMenuOpen} sx={{ ml: 2 }}>
              <AccountCircleIcon />
            </IconButton>
            <Typography variant="body1" sx={{ ml: 2 }}>
              {username}
            </Typography>
          </Box>
          <Menu
            anchorEl={anchorEl}
            open={isMenuOpen}
            onClose={handleMenuClose}
            PaperProps={{
              sx: {
                backgroundColor: '#0A0A0A',
                color: '#fff',
              },
            }}
          >
            <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose}>My Account</MenuItem>
            <MenuItem onClick={handleLogout}>Logout</MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={() => setDrawerOpen(false)}
        PaperProps={{
          sx: {
            backgroundColor: '#0A0A0A',
            color: '#fff',
          },
        }}
      >
        <List sx={{ width: 250 }}>
          <ListItem button onClick={() => setDrawerOpen(false)}>
            <ListItemIcon>
              <CloseIcon style={{ color: '#fff' }} />
            </ListItemIcon>
          </ListItem>
          <ListItem button component="a" href="/home">
            <ListItemText primary="Home" />
          </ListItem>
          <ListItem button component="a" href="/about-us">
            <ListItemText primary="About us" />
          </ListItem>
          <ListItem button component="a" href="/partner">
            <ListItemText primary="Partner With Us" />
          </ListItem>
          <ListItem button component="a" href="/membership-management">
            <ListItemText primary="Membership Management" />
          </ListItem>
          <ListItem button component="a" href="/book-now">
            <ListItemText primary="Book Now" />
          </ListItem>
          <ListItem button component="a" href="/news-events">
            <ListItemText primary="News and Events" />
          </ListItem>
          <ListItem button component="a" href="/careers">
            <ListItemText primary="Careers" />
          </ListItem>
          <ListItem button component="a" href="/blogs">
            <ListItemText primary="Blogs" />
          </ListItem>
        </List>
      </Drawer>
    </ThemeProvider>
  );
};

export default Dashboard;
